import React from 'react';
import { motion } from 'framer-motion';

interface Project {
  title: string;
  description: string;
  technologies: string[];
  githubUrl: string;
  imageUrl?: string;
}

const Projects: React.FC = () => {
  const projects: Project[] = [
    {
      title: 'SY Fitness Club',
      description:
        'Full-stack web application with role-based admin/member panel, real-time registration, and animated UI. Features include RESTful backend, ERD, SRS, and Use Case diagrams.',
      technologies: ['React', 'Node.js', 'Express.js', 'MySQL'],
      githubUrl: 'https://github.com/Yousufza89/SY-Fitness-Club',
    },
    {
      title: 'Car Rental System',
      description:
        'CLI application for car booking, billing, and return logic. Implements efficient data structures and algorithms for managing rental operations.',
      technologies: ['C++', 'Data Structures', 'Algorithms'],
      githubUrl: 'https://github.com/Yousufza89',
    },
    {
      title: 'Parallel Matrix Inversion',
      description:
        'Multithreaded implementation of matrix inversion algorithm using OpenMP. Achieves 80% faster performance compared to sequential implementation.',
      technologies: ['C++', 'OpenMP', 'Parallel Computing'],
      githubUrl: 'https://github.com/Yousufza89',
    },
    {
      title: 'Generic Sorting Tool',
      description:
        'Low-level sorting implementation in x86 Assembly supporting multiple data types. Demonstrates efficient memory management and optimization techniques.',
      technologies: ['x86 Assembly', 'Low-level Programming'],
      githubUrl: 'https://github.com/Yousufza89',
    },
    {
      title: 'Reader-Writer Semaphore',
      description:
        'Custom system call implementation for safe shared access in concurrent systems. Ensures thread safety and prevents race conditions.',
      technologies: ['C', 'Operating Systems', 'Concurrency'],
      githubUrl: 'https://github.com/Yousufza89',
    },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const cardVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.5,
      },
    },
  };

  return (
    <div className="min-h-screen pt-16">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-20">
        <motion.div
          className="text-center mb-16"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <h1 className="text-4xl font-bold mb-4">My Projects</h1>
          <p className="text-lg text-gray-600 dark:text-gray-400 max-w-3xl mx-auto">
            A collection of projects showcasing my skills in full-stack development,
            system programming, and algorithm implementation.
          </p>
        </motion.div>

        <motion.div
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          {projects.map((project, index) => (
            <motion.div
              key={index}
              className="card group"
              variants={cardVariants}
              whileHover={{ y: -5 }}
            >
              <h3 className="text-xl font-semibold mb-3">{project.title}</h3>
              <p className="text-gray-600 dark:text-gray-400 mb-4">
                {project.description}
              </p>
              <div className="flex flex-wrap gap-2 mb-4">
                {project.technologies.map((tech) => (
                  <span
                    key={tech}
                    className="px-2 py-1 bg-primary-light/10 dark:bg-primary-dark/10 rounded-full text-xs"
                  >
                    {tech}
                  </span>
                ))}
              </div>
              <a
                href={project.githubUrl}
                target="_blank"
                rel="noopener noreferrer"
                className="inline-flex items-center text-primary-light dark:text-primary-dark hover:underline"
              >
                View on GitHub
                <svg
                  className="w-4 h-4 ml-1"
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M10 6H6a2 2 0 00-2 2v10a2 2 0 002 2h10a2 2 0 002-2v-4M14 4h6m0 0v6m0-6L10 14"
                  />
                </svg>
              </a>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </div>
  );
};

export default Projects;
